import './login_page.css';

import Navbar from 'react-bootstrap/Navbar'
import { Redirect } from 'react-router';

import React from 'react';


class Login extends React.Component {
    render() {
        console.log("id", this.props.trader_id)
        if (this.props.trader_id == null) {
            return (
                <div>
                  <Navbar bg="light" expand="lg">
                    <Navbar.Brand>{this.props.connected}</Navbar.Brand>
                  </Navbar>
                  <div className="login-page">
                    <b>Username</b>
                    <input type="text"></input>
                    <button className="login-button" onClick={() => this.props.login("aj")}>Login</button>
                  </div>
                </div>
            )
        }

        return <Redirect push to="/TraderInterface" />
    }
}

export default Login
